import React from 'react'

class App extends React.App{
  constructor(props){
    super(props);
    this.state = {
      dinos: []
    }
  }

  componentDidMount(){
    const url = "http://127.0.0.1:8000/api/dinos/";
    fetch(url)
    .then(res => res.json())
    .then(data => this.setState({shoes: data}));
  }

  render() {
    return (
      <div>
      <h1>Welcome to the Ark DinoDB frontend</h1>
        <ul>
          {this.state.dinos.map((s) => (
            <li key={s.id} className='shoeDetails'>
              <p>Shoe id: {s.id}</p>
              <p>Brand Name: {s.brand_name}</p>
              <p>Color: {s.color}</p>
              <p>Manufacturer: {s.manufacturer}</p>
            </li>
          ))}
        </ul>
      </div>
    );
  }
}

export default App;
